import AppLayout from "../components/AppLayout";
import { useRouter } from 'next/router';

const Post = () => {
    const router = useRouter();
    const {id} = router.query;
    return (
        <AppLayout>
            <h1>{id}</h1>
            <p>This is the blog post content.</p>
        </AppLayout>
    )
};
